import "./App.css";
import { Routes, Route } from "react-router-dom";
import Login from "./papeg/user/login";

function App() {
    return ( <
        Router >
        <
        Routes >
        <
        Route path = "login"
        element = { < Login / > }
        /> <
        /Routes> <
        /Router>
    );
}
